package GuessTheOutput;

public class Demo10 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		String num="10";

		String num1="11";
		
		String num2="13";
		
		String num3="14";

		double double1 = Double.parseDouble(num);

		float float1 = Float.parseFloat(num1);

		System.out.println(float1+1);

		System.out.println(double1+1);
		
		Double valueOf = Double.valueOf(num2);
		
		System.out.println(valueOf+1);
		
		Integer valueOf2 = Integer.valueOf(num3);
		
		System.out.println(valueOf2+1);




	}

}
